import ReactDOM from 'react-dom';

const Hello = (props) => {
  return (
    <div>
    <p>Hello {props.name}, you are {props.age} years old</p>
    </div>
  )
}

const App = () => {
  const name = 'John'
  const age = 10
  return (
    <>
    <h1>Greetings</h1>
